Cubrir el traslado colectivo de estudiantes a centros de enseñanza ya sea pública o privada que una las localidades o parajes de:
a) Cerro Carmelo, Colonia Arrué, San Roque y Juan González con la ciudad de Carmelo; 
b) Víboras, Las Flores y Punta Arenales con la ciudad de Carmelo;
c) Costa Polonio y Barracas Coloradas con la ciudad de Nueva Helvecia; 
d) Manantiales y Barker con la ciudad de Rosario; 
e) La Laguna con la ciudad de Ombúes de Lavalle, 
f) Tala de Miguelete con la ciudad de Ombúes de Lavalle y 
g) Cerro de las Armas con la localidad de Colonia Miguelete
